import TodoItem from "./TodoItem";

function TodoItems(props) {
    return (
        <ul className="todolist-items">
            <TodoItem title="Faire les courses" />
            <TodoItem title="Nourrir le chat" />
            <TodoItem title="Apprendre React" />
        </ul>
    );
}

export default TodoItems;
